#import "SUALayer.h"
#import "AppConstants.h"
#import "WorldWind/Geometry/WWLocation.h"
#import "WorldWind/Shapes/WWAirspacePolygon.h"
#import "WorldWind/Shapes/WWShapeAttributes.h"
#import "WorldWind/Util/WWColor.h"
#import "WorldWind/WorldWindConstants.h"
#import "WorldWind/WWLog.h"

@implementation SUALayer

- (id) init
{
    self = [super init];

    [self setDisplayName:@"Airspaces"];
    [self parseAirspaces:[SUALayer airspaces]];

    return self;
}

- (void) parseAirspaces:(NSArray*)airspaces
{
    for (NSDictionary* propertyList in airspaces)
    {
        NSDictionary* properties = [propertyList objectForKey:@"properties"];
        id coordinates = [propertyList objectForKey:@"coordinates"];

        id lowerAlt = [properties objectForKey:@"LOWER_ALT"];
        id upperAlt = [properties objectForKey:@"UPPER_ALT"];
        id type = [properties objectForKey:@"TYPE"];

        if (coordinates != nil && lowerAlt != nil && upperAlt != nil)
        {
            double lowerAltitude;
            double upperAltitude;
            NSString* lowerAltitudeMode;
            NSString* upperAltitudeMode;
            [self parseAltitude:lowerAlt altitude:&lowerAltitude altitudeMode:&lowerAltitudeMode];
            [self parseAltitude:upperAlt altitude:&upperAltitude altitudeMode:&upperAltitudeMode];

            NSArray* locations = [self parseCoordinates:coordinates];
            WWAirspacePolygon* shape = [[WWAirspacePolygon alloc] initWithLocations:locations
                                                                      lowerAltitude:lowerAltitude
                                                                      upperAltitude:upperAltitude];
            [shape setUserObject:properties];
            [shape setLowerAltitudeMode:lowerAltitudeMode];
            [shape setUpperAltitudeMode:upperAltitudeMode];

            WWShapeAttributes* attrs;
            [self parseType:type attributes:&attrs];
            [shape setAttributes:attrs];

            [self addRenderable:shape];
        }
    }
}

- (NSArray*) parseCoordinates:(id)coordinateString
{
    NSArray* components = [coordinateString componentsSeparatedByString:@", "];

    NSMutableArray* array = [[NSMutableArray alloc] init];
    for (NSUInteger i = 0; i < [components count]; i += 2)
    {
        [array addObject:[[WWLocation alloc] initWithDegreesLatitude:[[components objectAtIndex:i] doubleValue]
                                                           longitude:[[components objectAtIndex:i + 1] doubleValue]]];
    }

    return array;
}

- (void) parseAltitude:(id)altitudeString altitude:(double*)altitude altitudeMode:(NSString**)altitudeMode
{
    NSRange range;

    if ([altitudeString isEqualToString:@"UNLTD"])
    {
        *altitude = 50000; // 50km, the top of the stratosphere
    }
    else if ((range = [altitudeString rangeOfString:@"AMSL"]).location != NSNotFound) // 000AMSL
    {
        *altitude = [[altitudeString substringToIndex:range.location] doubleValue] / TAIGA_METERS_TO_FEET;
        *altitudeMode = WW_ALTITUDE_MODE_ABSOLUTE;
    }
    else if ((range = [altitudeString rangeOfString:@"AGL"]).location != NSNotFound) // 000AGL
    {
        *altitude = [[altitudeString substringToIndex:range.location] doubleValue] / TAIGA_METERS_TO_FEET;
        *altitudeMode = WW_ALTITUDE_MODE_RELATIVE_TO_GROUND;
    }
    else if ((range = [altitudeString rangeOfString:@"FL"]).location != NSNotFound) // FL000
    {
        *altitude = [[altitudeString substringFromIndex:NSMaxRange(range)] doubleValue] * 100 / TAIGA_METERS_TO_FEET;
        *altitudeMode = WW_ALTITUDE_MODE_ABSOLUTE;
    }
    else if ([altitudeString isEqualToString:@"SURFACE"] || [altitudeString isEqualToString:@"GND"])
    {
        *altitude = 0;
        *altitudeMode = WW_ALTITUDE_MODE_CLAMP_TO_GROUND;
    }
    else
    {
        *altitude = 0;
        *altitudeMode = WW_ALTITUDE_MODE_ABSOLUTE;
        WWLog(@"Unrecognized SUA altitude %@", altitudeString);
    }
}

- (void) parseType:(id)typeString attributes:(WWShapeAttributes**)attributes
{
    if ([typeString isEqualToString:@"M"]) // MILITARY OPERATIONS AREA
    {
        WWShapeAttributes* attrs = [[WWShapeAttributes alloc] init];
        [attrs setInteriorColor:[[WWColor alloc] initWithR:0 g:1 b:0 a:0.5]];
        [attrs setOutlineColor:[[WWColor alloc] initWithR:0 g:0 b:0 a:1]];
        [attrs setOutlineWidth:1.5];
        *attributes = attrs;
    }
    else if ([typeString isEqualToString:@"R"]) // RESTRICTED
    {
        WWShapeAttributes* attrs = [[WWShapeAttributes alloc] init];
        [attrs setInteriorColor:[[WWColor alloc] initWithR:1 g:0.65 b:0 a:0.5]];
        [attrs setOutlineColor:[[WWColor alloc] initWithR:0 g:0 b:0 a:1]];
        [attrs setOutlineWidth:1.5];
        *attributes = attrs;
    }
    else if ([typeString isEqualToString:@"W"]) // WARNING
    {
        WWShapeAttributes* attrs = [[WWShapeAttributes alloc] init];
        [attrs setInteriorColor:[[WWColor alloc] initWithR:1 g:1 b:0 a:0.5]];
        [attrs setOutlineColor:[[WWColor alloc] initWithR:0 g:0 b:0 a:1]];
        [attrs setOutlineWidth:1.5];
        *attributes = attrs;
    }
    else
    {
        WWShapeAttributes* attrs = [[WWShapeAttributes alloc] init];
        [attrs setInteriorColor:[[WWColor alloc] initWithR:0.5 g:0.5 b:0.5 a:0.5]];
        [attrs setOutlineColor:[[WWColor alloc] initWithR:0 g:0 b:0 a:1]];
        [attrs setOutlineWidth:1.5];
        WWLog(@"Unrecognized SUA type %@", typeString);
    }
}

